import React from "react";
import "./css/style.css";

import axios from "axios";

class GalleryPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      projects: []
    };
  }

  render() {
    return (
      <div>
        <h1>This is the Project Gallery Page</h1>
      </div>
    );
  }
} //END OF CLASS

export default GalleryPage;
